Gift card deals are special offers for selected products;

The gift card deals will automatically be activated if a customer uses gift card balance at check out and the balance is sufficient to pay for the total price of the shopping cart products with gift card deals;

You will not be able to activate the gift card deals if you choose other payment methods besides gift card. The products will be purchased at their normal prices;

If your account balance is not enough to pay for the products with gift card deals, you can choose to reload your gift card balance by clicking on the Reload button at either shopping cart page or check out page;

Products that have gift card deals can be recognized by a special symbol showing 'GC Deal';

For any additional questions or concerns, please contact our customer service;

Yamibuy reserves the right of final interpretation.

Return Policy

Yami is committed to provide our customers with a peace of mind when purchasing from us. Most items shipped from Yamibuy.com can be returned within 30 days of receipt of shipment (For Food, Beverages, Snacks, Dry Goods, Health supplements, Fresh Grocery and Perishables Goods, within 7 days of receipt of shipment due to damages or quality issues; To ensure that every customer receives safe and high-quality products, we do not provide refunds or returns for beauty products once they have been opened or used, except in the case of quality issues; Some products may have different policies or requirements associated with them, please see below for products under special categories, or contact Yami Customer Service for further assistance).Thank you for your understanding and support.

Learn More

Terms and Conditions of Yami E-Gift Card

If you choose “Redeem automatically” as your delivery method, your gift card balance will be reload automatically after your order has been processed successfully;

If you choose “Send to Email”as your delivery method, the card number and CVV will be sent to the email address automatically;

Any user can use the card number and CVV to redeem the gift card, please keep your gift card information safely. If you have any trouble receiving email, please contact Yami customer service;

Yami gift card can be used to purchase both Yami owned or Marketplace products;

Yami gift card will never expire;

Yami gift card balance does not have to be used up at once;

All rights reserved by Yami.

Return Policy

We take responsibility for wrong shipments, missing items, and the loss/damage of goods caused by the shipments. After the receipt of the package, We do not accept any return or exchange caused other than quality issues. We promise to pack carefully; however, minor damages to the package may occur due to the long journey to desinations. Any damages not causing internal goods quality problems are not allowed to return or exchange. If you open the package and find any quality issues, please contact our customer service team within three days after the receipt of goods.

Return Policy

You may return products within 30 days upon receiving the products. Sellers take responsibilities for any wrong shipment or missing items. Packing needs to be unopened for any other than quality issues return. We promise to pack carefully, but because goods are taking long journey to destinations, simple damages to packaging may occur. Any damages not causing internal goods quality problems are not allowed to return. If you open the package and any quality problem is found, please contact customer service within three days after receipt of goods.

Shipping Information

Yami Consolidation Service Shipping Fee $9.99(Free shipping over $69)

Sellers in China will ship their orders within 1-2 business days once the order is placed. Packages are sent to our consolidation warehouse in China and combined there. Our Yami consolidation warehouse will directly ship the packages to you via UPS. The average time for UPS to ship from China to the United States is about 10 working days and it can be traced using the tracking number. Due to the pandemic, the delivery time may be delayed by about 5 days. The package needs to be signed by the guest. If the receipt is not signed, the customer shall bear the risk of loss of the package.

Shipping

EMS/UPS/DHL $19.99(Free shipping over $99)

Due to the Japanese New Year holiday in 2024, the logistics is out of service and orders cannot be shipped during 12/27-1/3, and the order will be sent 5-7 days later. After the holidays, the orders will be sent together, please understand the slight delay. The seller will ship the orders within 1-2 business days. If the package incurs any import tariff, the customer should take care by themselves. The US Custom may require the customer to provide personal information such as passport info. If the customer refuses to provide and thus causes the return or trash of the package, the customer shall take responsibility for the loss. Please provide correct shipping information, otherwise, the customer shall take responsibility for the loss caused by the wrong information. The package will need your signature, so please check your email and text messages to make sure the carrier could reach out to you. Thank you for your understanding!

